import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className='header'>
        <h1>מסעדות מומלצות בצפון</h1>
          <div className='links'>
            <Link>חפש לפי מיקום</Link>
            <a>מבצעים מותאמים אישית</a>
          </div>
      </div>

    </div>
  );
}

export default App;
